Assouline reveals the Special Edition of #Versailles: From Louis XIV to Jeff Koons, housed in an elegant green velvet clamshell case with a textured golden medallion, evoking the elevated extravagance of the palace. Each purchase of the limited edition of Versailles: From Louis XIV to Jeff Koons includes a private tour of Versailles led by a curator of the palace and features an exclusive look at rooms not open to the public.

