The latest addition to the Ultimate Collection, Yachts: The Impossible Collection is a nautical dive into the most historically significant luxury vessels of the last 170 years: from original J Class yachts of the late 1800s to current high-tech megayachts, from timeless classics to head-turners that broke the mold with daring design and redefined their era.

